import React from 'react'
import styles from './login.module.css'
import Deneme from '../deneme/deneme'
import Courier from '../icon/Courier'
function Login() {
    return (
        <div className={styles.loginPage}>
            <Deneme />
            <Courier style={{ fontSize: 250 }} />
        </div>
    )
}
export default Login
